import {
  Routes,
  Route,
  useNavigationType,
  useLocation,
} from "react-router-dom";
import HomepageDesktop from "./pages/HomepageDesktop";
import RankingsDesktop from "./pages/RankingsDesktop";
import MarketplaceDesktop from "./pages/MarketplaceDesktop";
import ConnectWalletDesktop from "./pages/ConnectWalletDesktop";
import NFTPageDesktop from "./pages/NFTPageDesktop";
import ArtistPageDesktop from "./pages/ArtistPageDesktop";
import CreateAccountDesktop from "./pages/CreateAccountDesktop";
import HomepageTablet from "./pages/HomepageTablet";
import { useEffect } from "react";

function App() {
  const action = useNavigationType();
  const location = useLocation();
  const pathname = location.pathname;

  useEffect(() => {
    if (action !== "POP") {
      window.scrollTo(0, 0);
    }
  }, [action, pathname]);

  useEffect(() => {
    let title = "";
    let metaDescription = "";

    switch (pathname) {
      case "/":
        title = "";
        metaDescription = "";
        break;

      case "/rankings-desktop":
        title = "";
        metaDescription = "";
        break;

      case "/marketplace-desktop":
        title = "";
        metaDescription = "";
        break;

      case "/connect-wallet-desktop":
        title = "";
        metaDescription = "";
        break;

      case "/nft-page-desktop":
        title = "";
        metaDescription = "";
        break;

      case "/artist-page-desktop":
        title = "";
        metaDescription = "";
        break;
      case "/create-account-mobile":
        title = "";
        metaDescription = "";
        break;
      case "/create-account-tablet":
        title = "";
        metaDescription = "";
        break;
      case "/create-account-desktop":
        title = "";
        metaDescription = "";
        break;
      case "/homepage-mobile":
        title = "";
        metaDescription = "";
        break;
      case "/homepage-tablet":
        title = "";
        metaDescription = "";
        break;
    }

    if (title) {
      document.title = title;
    }

    if (metaDescription) {
      const metaDescriptionTag = document.querySelector(
        'head > meta[name="description"]'
      );
      if (metaDescriptionTag) {
        metaDescriptionTag.content = metaDescription;
      }
    }
  }, [pathname]);

  return (
    <Routes>
      <Route path="/" element={<HomepageDesktop />} />
      <Route path="/rankings-mobile" element={<RankingsMobile />} />
      <Route path="/rankings-tablet" element={<RankingsTablet />} />
      <Route path="/rankings-desktop" element={<RankingsDesktop />} />
      <Route path="/marketplace-mobile" element={<MarketplaceMobile />} />
      <Route path="/marketplace-tablet" element={<MarketplaceTablet />} />
      <Route path="/marketplace-desktop" element={<MarketplaceDesktop />} />
      <Route path="/connect-wallet-mobile" element={<ConnectWalletMobile />} />
      <Route path="/connect-wallet-tablet" element={<ConnectWalletTablet />} />
      <Route
        path="/connect-wallet-desktop"
        element={<ConnectWalletDesktop />}
      />
      <Route path="/nft-page-mobile" element={<NFTPageMobile />} />
      <Route path="/nft-page-tablet" element={<NFTPageTablet />} />
      <Route path="/nft-page-desktop" element={<NFTPageDesktop />} />
      <Route path="/artist-page-mobile" element={<ArtistPageMobile />} />
      <Route path="/artist-page-tablet" element={<ArtistPageTablet />} />
      <Route path="/artist-page-desktop" element={<ArtistPageDesktop />} />
      <Route path="/create-account-mobile" element={<CreateAccountMobile />} />
      <Route path="/create-account-tablet" element={<CreateAccountTablet />} />
      <Route
        path="/create-account-desktop"
        element={<CreateAccountDesktop />}
      />
      <Route path="/homepage-mobile" element={<HomepageMobile />} />
      <Route path="/homepage-tablet" element={<HomepageTablet />} />
    </Routes>
  );
}
export default App;
